window.bookSummaryJSON = "<p>Only a fool would target the deadliest order of assassins in the galaxy.</p> <p>The galaxy had no shortage of fools.</p> <p>Someone had attacked the Order, and done so with both blades and magic. It was utterly unheard of, but even the most elite of killers sometimes faced the unexpected, and on this occasion, that could even mean their demise. That is, unless they could get to the bottom of the nefarious plot.</p> <p>Joined by a former space pirate and the motley band of misfits crewing his ship, the master assassin set out to lead the rag-tag group to the ends of space, hunting their prey with deadly skill. But sometimes the hunter became the hunted, and tables could turn in an instant.</p> <p>Kill or be killed, that was the assassin's way. It was an easy choice. That is, unless you found yourself fighting your former lover. That could be awkward. Awkward and deadly.</p> <p><b>Contains:</b></p> <p></p> <ol> <li><i>The Interstellar Slayer</i></li> <li><i>The Vespus Blade</i></li> </ol>"; 
